import React from 'react';
import './C_login/style_login.css';
function Email() {
  
    return (    
      <div class="login_email"> 
        <label for="email">Email:</label>
        <input type="email" id="emailid" name="emailaddress"></input>
      </div>
    );
  }
  
  export default Email;
